/// Get the diacritics version of a word (binary search)
pub fn get_en_diacritics(word: &str) -> Option<&'static str> {
    EN_DIACRITICS_RULES
        .binary_search_by_key(&word, |(w, _)| *w)
        .ok()
        .map(|idx| EN_DIACRITICS_RULES[idx].1)
}
